import React from 'react';
import './App.css';

class App extends React.Component {
  render() {
    return (
      <div>
        <form>
          <input placeholder="Image Url" />
          <br />
          <input placeholder="Choose Title" />
          <br />
          <input placeholder="Why is it ugly?" />


          <input type="submit" />
        </form>

        <div id="ugly-list"></div>
      </div>
    );

  }

}

export default App;




